import React from "react";
const Blog = (props) => {
  return (
    // <div className="my-6 mx-5">
    <div className="mx-5 my-4 bg-light border-4" style={{ height: "200px" }}>
      <div className="card  text-light text-md-center">
        <div className="card-body">
          <h5 className="card-title my-5">Special title treatment{props.title}</h5>
          <p className="card-text">
            With supporting text below as a natural lead-in to additional
            content.
          </p>
        </div>
      </div>
    </div>
  );
};

export default Blog;
